import React from 'react';
import './imgContainer.css';

const ImgShow=({imgUrl,boxSz})=>{
  console.log(boxSz);
if (imgUrl.length>0){

  return (<div>
    <img src={imgUrl} id='imageContainer' alt="Human" height='400px' width='auto'  className='br4 pt2'/>
    <div style={{top:boxSz.topCol,right:boxSz.rightCol,bottom:boxSz.bottomCol,left:boxSz.leftCol ,boxShadow:'2px solid red'}}></div>
  </div>);
}
return (<div></div>);

}
export default ImgShow;
